import * as React from "react";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Grid from "@mui/material/Grid";
import Stack from "@mui/material/Stack";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import Link from "@mui/material/Link";
import placeholder from '../assets/img/placeholder-image.png';
import ProjectPendo from "./ProjectPendo";
import { CustomPalette } from "../theme/palette";
import ProjectDesignLibrary from "./ProjectDesignLibrary";

function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary" align="center">
      {"Copyright © "}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

const cards = [1, 2];

export default function Home() {
  return (
    <React.Fragment>
      {/** H1 Title */}
      <Container
        sx={{
          bgcolor: "background.paper",
          pt: 24,
          pb: 6,
        }}
      >
        <Container maxWidth="sm">
          <Typography
            component="h1"
            variant="h2"
            align="center"
            color="text.primary"
            gutterBottom
          >
            Hi, I'm Braxton :)
          </Typography>
          <Typography
            variant="h5"
            align="center"
            color="text.secondary"
            paragraph
          >
            I'm a designer passionate about <b>users</b>, <b>design systems</b>
            .......and <b>Star Wars</b>
          </Typography>
          <Stack
            sx={{ pt: 4 }}
            direction="row"
            spacing={2}
            justifyContent="center"
          >
            <Button variant="contained">Main call to action</Button>
            <Button variant="outlined">Secondary action</Button>
          </Stack>
        </Container>
      </Container>

      {/** Container Grid of Cards */}
      <Container sx={{
        /* Auto layout */
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'flex-start',
        padding: '128px 0px',
        gap: '64px',
      }}>
        <ProjectPendo/>
        <ProjectDesignLibrary/>
      </Container>

      {/* Footer */}
      <Box sx={{ bgcolor: "background.paper", p: 6 }} component="footer">
        <Typography variant="h6" align="center" gutterBottom>
          Footer
        </Typography>
        <Typography
          variant="subtitle1"
          align="center"
          color="text.secondary"
          component="p"
        >
          Something here to give the footer a purpose!
        </Typography>
        <Copyright />
      </Box>
      {/* End footer */}
    </React.Fragment>
  );
}
